// index.js
const defaultAvatarUrl = 'https://mmbiz.qpic.cn/mmbiz/icTdbqWNOwNRna42FI242Lcia07jQodd2FJGIYQfG0LAJGFxM4FbnQP6yfMxBgJ0F3YRqJCJ1aPAK2dQagdusBZg/0'

Page({
  data: {
    // 备注
    motto: '- 点击头像授权生成 -',
    // 用户信息
    userInfo: {
      // 头像
      avatarUrl: defaultAvatarUrl!=null?defaultAvatarUrl:'',
      // 昵称
      nickName: '',
    },
    templateImage: {
      img_1008:'data:image/png;base64,',
      img_1007:'data:image/png;base64,',
      img_1005: 'data:image/png;base64,',
      img_1004: 'data:image/png;base64,',
      img_1003: 'data:image/png;base64,',
      img_1002: 'data:image/png;base64,',
      img_1001: 'data:image/png;base64,',
    },
      // 图片尺寸
      imginfo:{
        width: 0,
        height: 0
      },
    // 是否显示头像模板
    showTemplate:false,
    // 是否合并图片
    hasNewImg: false, // 不生效
    // 是否有用户信息
    hasUserInfo: false,
    // 是否可以使用getUserProfile
    canIUseGetUserProfile: wx.canIUse('getUserProfile'),
    // 是否可以使用button.open-type.getUserInfo
    canIUseNicknameComp: wx.canIUse('input.type.nickname'),
  },
  // 选择模板
  selectTemplate: function() {
    this.setData({
      showTemplate: !this.data.showTemplate
    })
  },
  // 点击图片
  onImageClick: function(e) {


    let that = this;

    wx.showToast({
      title: 'Image clicked!',
      icon: 'none'
    });

      const timestamp = Date.now();

      // 获取base64本地图片获取路径
      var base64 =  e.currentTarget.dataset.img;//base64格式图片
      var imgPath = wx.env.USER_DATA_PATH+'/index_'+timestamp+ '.png';
      //如果图片字符串不含要清空的前缀,可以不执行下行代码.
      var imageData = base64.replace(/^data:image\/\w+;base64,/, "");
      var fs = wx.getFileSystemManager();
      fs.writeFileSync(imgPath, imageData, "base64");
      console.log('打印本地base64图片路径：',imgPath);


      wx.downloadFile({
          url: that.data.userInfo.avatarUrl,
          success(res) {

              console.log('下载图片res：',res.tempFilePath);

              // 绘制背景海报到canvas
              const ctx = wx.createCanvasContext('shareCanvas',that)
              // 背景图片
              ctx.drawImage(res.tempFilePath, 0, 0, 200, 200)
              // 模板图片
              ctx.drawImage(imgPath, 0, 0, 200, 200)

              ctx.draw(false, () => {
                  wx.canvasToTempFilePath({
                      canvasId: 'shareCanvas',
                      success: function(res) {
                        console.log('canvasToTempFilePath:',res);

                          var tempFilePath = res.tempFilePath;
                          that.data.userInfo.avatarUrl = tempFilePath;

                          that.setData({
                              hasNewImg: true
                          });

                          console.log('hasNewImg:',that.data.hasNewImg);

                        //   wx.getImageInfo({
                        //     src: tempFilePath,
                        //     success: function (res) {
                        //         that.data.imginfo.width = res.width;
                        //         that.data.imginfo.height = res.height;
                        //         console.log('imgwidth：',that.data.imginfo.width);
                        //         console.log('imgheight：',that.data.imginfo.width);
                        //     }
                        // })

                          // 你可以在这里执行进一步的操作，例如将图片保存到相册
                          // wx.saveImageToPhotosAlbum({
                          //     filePath: tempFilePath,
                          //     success: function() {
                          //         wx.showToast({
                          //             title: '图片已保存到相册',
                          //             icon: 'success'
                          //         });
                          //     },
                          //     fail: function(err) {
                          //         console.error('保存图片失败:', err);
                          //     }
                          // });

                      },
                      fail: function(err) {
                          console.error('canvasToTempFilePath failed:', err);
                      }
                  });
              });

          },
          fail(err) {
              console.error('下载图片失败：', err);
          }
      })

      

      this.selectTemplate();

  },
  bindViewTap() {
    // wx.navigateTo({
    //   url: '../logs/logs'
    // })
  },
  onChooseAvatar(e) {

    console.log('点击头像授权生成',e);

    const { avatarUrl } = e.detail
    const { nickName } = this.data.userInfo
    this.setData({
      "userInfo.avatarUrl": avatarUrl,
      hasUserInfo: avatarUrl !== defaultAvatarUrl,
    })
  },
  onInputChange(e) {
    const nickName = e.detail.value
    const { avatarUrl } = this.data.userInfo
    this.setData({
      "userInfo.nickName": nickName,
      hasUserInfo: nickName && avatarUrl && avatarUrl !== defaultAvatarUrl,
    })
  },
  getUserProfile(e) {
    // 推荐使用wx.getUserProfile获取用户信息，开发者每次通过该接口获取用户个人信息均需用户确认，开发者妥善保管用户快速填写的头像昵称，避免重复弹窗
    wx.getUserProfile({
      desc: '展示用户信息', // 声明获取用户个人信息后的用途，后续会展示在弹窗中，请谨慎填写
      success: (res) => {
        console.log(res)

        console.log('打印获取用户信息:',res);
        this.setData({
          userInfo: res.userInfo,
          hasUserInfo: true
        })
      }
    })
  },
})
